import React from "react";
import Navbar from "../components/Navbar";
import CEOImg from "../assets/avishek.jpg"; 
import MDImg from "../assets/sushil.png";
import COOImg from "../assets/sabin.jpg";
import CIOImg from "../assets/pranay.jpg";

function Team() {
  return (
    <>
      <Navbar />
      <h1 style={{ textAlign: 'center', color: '#632020' }}>About Us</h1>
      <p style={{ textAlign: 'center' }}>Our team is full of passionate people ready to make your dream software come true.</p>
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-around' }}>
        <div style={{ flex: 1, padding: '10px', border: '2px solid #ddd', borderRadius: '5px', textAlign: 'center' }}>
          <img src={CEOImg} alt="CEO" style={{ maxHeight: '100%', maxWidth: '70%' }} />
          <h3>Avishek Subedi</h3>
          <h4>Chief Executive Officer</h4>
        </div>
        <div style={{ flex: 1, padding: '10px', border: '2px solid #ddd', borderRadius: '5px', textAlign: 'center' }}>
          <img src={MDImg} alt="MD" style={{ maxHeight: '20%', maxWidth: '70%' }} />
          <h3>Sushil Baral</h3>
          <h4>Managing Director</h4>
        </div>
        <div style={{ flex: 1, padding: '10px', border: '2px solid #ddd', borderRadius: '5px', textAlign: 'center' }}>
          <img src={COOImg} alt="MD" style={{ maxHeight: '20%', maxWidth: '70%' }} />
          <h3>Sabin Adhikari</h3>
          <h4>Chief Operation Officer</h4>
        </div>
        <div style={{ flex: 1, padding: '10px', border: '2px solid #ddd', borderRadius: '5px', textAlign: 'center' }}>
          <img src={CIOImg} alt="MD" style={{ maxHeight: '10%', maxWidth: '70%' }} />
          <h3>Pranay Shakya</h3>
          <h4>Chief Information Officer</h4>
        </div>
      </div>
      
    </>
  );
}

export default Team;
